        public static string VehiclesDictionary = @"{""vehicles"": [{""TankId"":16401,""Name"":""Waffentr\u00E4ger auf Pz. IV"",""Description"":""Tank destroyer developed in February 1944 on the basis of the PzIV tank. Development was discontinued in favor of a similar vehicle on the basis of the Krupp Waffentrager 12.8 cm PaK 44 of Czech origin. Existed only in blueprints."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Waffentrager_IV.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Waffentrager_IV.png"",""PriceCredit"":3400000,""PriceGold"":0,""NexTanksInTree"":[19217]},{""TankId"":1297,""Name"":""Panther I"",""Description"":""This famous tank was produced from January 1943 through April 1945, with a total of 5,796 vehicles built plus eight vehicles built on the F series chassis."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzV.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzV.png"",""PriceCredit"":1380000,""PriceGold"":0,""NexTanksInTree"":[5137,8465]},{""TankId"":52497,""Name"":""Pz.Kpfw. 38H 735 (f)"",""Description"":""In May 1940 the French Army had more than 800 vehicles of this type, most of which were captured by the German forces. They were widely used by the Wehrmacht to supplement existing armor."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":2,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/H39_captured.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/H39_captured.png"",""PriceCredit"":0,""PriceGold"":750,""NexTanksInTree"":[]},{""TankId"":18961,""Name"":""Sp\u00E4hpanzer SP I C"",""Description"":""The reconnaissance tank destroyer was being developed by Hotchkiss and Kl\u00F6ckner-Humboldt-Deutz companies from 1956 through 1962 in order to increase the anti-tank capability of recon tank battalions. A 90-mm anti-tank gun was planned to be mounted on the new vehicle. The project was eventually declined. The number of prototypes built is unknown."",""IsPremium"":false,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G113_SP_I_C.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G113_SP_I_C.png"",""PriceCredit"":1360000,""PriceGold"":0,""NexTanksInTree"":[13841,18449]},{""TankId"":52241,""Name"":""Pz.Kpfw. B2 740 (f)"",""Description"":""During the European campaign, German troops captured 161 heavy B1 bis tanks that later received the Pz.Kpfw. B2 740 (f) designation. All vehicles were upgraded and received German radio equipment and twofold hatches on commander\u0027s cupolas. Some vehicles with dismantled armament were used for training purposes, and 16 vehicles were transformed into self-propelled howitzers. Most vehicles were converted into flame throwing tanks."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":4,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/B-1bis_captured.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/B-1bis_captured.png"",""PriceCredit"":0,""PriceGold"":1500,""NexTanksInTree"":[]},{""TankId"":7185,""Name"":""VK 30.01 (P)"",""Description"":""The Porsche company developed the concept of a new vehicle in 1939. On March 5, 1941, after numerous approvals, the company prepared blueprints and, in July 1941, produced the hull from mild steel. The hull and chassis (with detachable equipment for trenching) passed performance trials. One wooden prototype of the turret and one wooden prototype of the hull were manufactured. In 1942, the project was discontinued in favor of new heavy tanks."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK3001P.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK3001P.png"",""PriceCredit"":920000,""PriceGold"":0,""NexTanksInTree"":[10769]},{""TankId"":19985,""Name"":""Skorpion G"",""Description"":""Development of the second series of self-propelled guns on the basis of the Panther tank was started by the Rheinmetall company in January 1943. The design plans for the 12,8 cm Skorpion were completed on April 2, 1943. Existed only in blueprints."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G114_Rheinmetall_Scorpion.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G114_Rheinmetall_Scorpion.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":4369,""Name"":""Pz.Kpfw. III"",""Description"":""Production of the J variant started in March 1941. In addition to the enhanced armor, the vehicle received the new 50-mm KwK 38 gun, which was deemed extremely successful; 1,067 other vehicles featured the KwK 39 gun, the improved version with better penetration rate. An attempt to mount a 75-mm gun (the N variant) was recognized as a failure, and the most large-scale vehicles were the J, L, and M variants (with 50-mm guns that had an impeccable track record). A total of 5,691 vehicles were produced, among which 1,969 were equipped with long-barrel guns and 2,391 with short-barrel 50-mm guns."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzIII.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzIII.png"",""PriceCredit"":6000,""PriceGold"":0,""NexTanksInTree"":[17425,1809]},{""TankId"":21009,""Name"":""Panzer 58"",""Description"":""Developed in 1953 in Switzerland, the first prototype of this tank featured a 90 mm gun. A second prototype with a British 20-pounder gun was built later. In the end, a series of 10 vehicles, featuring 105 mm guns, were produced and remained in service until 1964. After this, the vehicles were used as a basis for the Panzer 61. The only Panzer 58 that survives today features a 20-pounder gun and is currently located in the tank museum in Thun, Bern."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G119_Pz58_Mutz.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G119_Pz58_Mutz.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":54289,""Name"":""L\u00F6we"",""Description"":""Development of this 70-ton super-heavy tank started on November 1, 1941. In February 1942, the Krupp company suggested the VK 70.01 avant project, later designated the L\u00F6we (\u0022Lion\u0022). Several designs varying in configuration, armament, and armor, were drafted. However, the project was canceled after the F\u00FChrer made the decision to develop even heavier tanks. No prototypes were ever built."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Lowe.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Lowe.png"",""PriceCredit"":0,""PriceGold"":7500,""NexTanksInTree"":[]},{""TankId"":22033,""Name"":""Agent"",""Description"":""A spy modernization of the VK 28.01 light tank made specially for Operation Off the Grid. The visual model of the tank received a laser reticle mounted on the turret and also animated camouflage with shining green lines. "",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK2801_BP.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK2801_BP.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":55313,""Name"":""8,8 cm Pak 43 Jagdtiger"",""Description"":""In 1945, the production order for the Jagdtiger was increased, and the supply of compatible guns became insufficient. As a result, approximately 20 vehicles were equipped with the 8,8 cm PaK 43 L/71 gun."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/JagdTiger_SdKfz_185.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/JagdTiger_SdKfz_185.png"",""PriceCredit"":0,""PriceGold"":7400,""NexTanksInTree"":[]},{""TankId"":6417,""Name"":""Pz.Kpfw. III/IV"",""Description"":""A project for the new vehicle with sloped armor plates and components of the Pz.Kpfw. III and Pz.Kpfw. IV was approved on January 4, 1944. In March 1944, a contract for three prototypes was signed, but the program was discontinued on July 12. Only a tank destroyer on a similar base saw mass production."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzIII_IV.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzIII_IV.png"",""PriceCredit"":0,""PriceGold"":250,""NexTanksInTree"":[]},{""TankId"":23057,""Name"":""Kunze Panzer"",""Description"":""A project for a medium tank with a forward-tilted turret axis and a turret placement of all crew members. Developed in 1964, existed only in blueprints."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G147_mPanzer_64.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G147_mPanzer_64.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":57361,""Name"":""Pz.Kpfw. IV Schmalturm"",""Description"":""On 25 May 1944, Jurgen Lukash, an engineer from the Krupp company, presented an experimental tank model based on the Pz. Kpfw. IV Schmalturm. The Starchaser was not approved by top management. But Stephen Pilberg, the famous philanthropist, invested $11 million in this project, which allowed a pilot version to be released on 25 May 1947. According to intelligence data, the tank was manufactured from metals mined at meteorite impact sites. The source of information that allowed the young engineer to create this unusual tank, remained a secret. The creator of the tank disappeared under mysterious circumstances together with all his blueprints. He was last seen on the lawn in front of his house, not far from Ludwigsburg: the engineer was musing on the starry sky\u2026"",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzIV_schmalturm.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzIV_schmalturm.png"",""PriceCredit"":0,""PriceGold"":3500,""NexTanksInTree"":[]},{""TankId"":16657,""Name"":""Rhm.-Borsig Waffentr\u00E4ger"",""Description"":""Developed by the Rheinmetall-Borsig company and designed as a special artillery carrier. The vehicle was designed to carry an artillery system as well as to fire from the chassis. The vehicle utilized the suspension of the Hetzer tank destroyer. Development continued from the end of 1942 through to the middle of 1944. However, the project was discontinued in favor of the Ardelt project because of a complicated design, high cost, and excessive weight."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/RhB_Waffentrager.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/RhB_Waffentrager.png"",""PriceCredit"":2400000,""PriceGold"":0,""NexTanksInTree"":[16401]},{""TankId"":25105,""Name"":""Barkhan"",""Description"":""This is the perfect tank for desert battles. Its strong armor lets you feel comfortable in face-to-face encounters with the enemy, while its powerful gun leaves them with no chance of surviving the battle."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G_VK3502_BP.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G_VK3502_BP.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":9489,""Name"":""E 100"",""Description"":""In June 1943, the Adlerwerke company received an order for development of the E 100. However, in 1944, heavy tank development was discontinued. By the end of the war, only the chassis was completed, which was later captured by the British Army."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/E-100.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/E-100.png"",""PriceCredit"":6100000,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":10513,""Name"":""VK 45.02 (P) Ausf. A"",""Description"":""Development of this vehicle started in April 1942. The Krupp company received an order for construction of turrets. However, the prototype was never manufactured. The turrets were mounted on the first Tiger IIs."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK4502A.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK4502A.png"",""PriceCredit"":2435000,""PriceGold"":0,""NexTanksInTree"":[7441]},{""TankId"":11537,""Name"":""Jagdpanther II"",""Description"":""Developed on the basis of the Panther II. The vehicle was to be equipped with a 128 mm gun and the fighting compartment to be located in the rear. Existed only in blueprints."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/JagdPantherII.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/JagdPantherII.png"",""PriceCredit"":2570000,""PriceGold"":0,""NexTanksInTree"":[7953]},{""TankId"":64529,""Name"":""E 25"",""Description"":""The development of the E 25 was part of the \u0022E\u0022 program, supervised by the Waffenpr\u00FCfamt 6 committee. The E 25 was developed by the Argus company (Karlsruhe, Germany) under the supervision of Dr. Herman Klaue. No prototypes were manufactured."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/E-25.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/E-25.png"",""PriceCredit"":0,""PriceGold"":7300,""NexTanksInTree"":[]},{""TankId"":14609,""Name"":""Leopard 1"",""Description"":""Main battle tank of the Federal Republic of Germany. Development was started in 1956. The first prototypes were built in 1965 at the Krauss-Maffei factory. The Leopard 1 saw service in the armies of more than 10 countries."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Leopard1.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Leopard1.png"",""PriceCredit"":6100000,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":17,""Name"":""Pz.Kpfw. IV Ausf. G"",""Description"":""Produced in greater numbers than any other tank of the Panzerwaffe. Manufactured from October 1937 through March 1945, with a total production of 8,519 tanks plus command vehicles. Beginning in May 1942 this tank was equipped with a long-barreled gun."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzIV.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzIV.png"",""PriceCredit"":400000,""PriceGold"":0,""NexTanksInTree"":[2321,7185]},{""TankId"":51729,""Name"":""Pz.Kpfw. II Ausf. J"",""Description"":""Reconnaissance tank with reinforced armor. The vehicle was a further development of the Pz.Kpfw II. In October 1939, a preproduction batch was ordered, and the first prototype was built in July 1940. From 1943 through 1944, seven vehicles were used by the 12th Panzer Division on the Eastern Front. A total of 22 tanks were manufactured."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzII_J.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzII_J.png"",""PriceCredit"":0,""PriceGold"":1000,""NexTanksInTree"":[]},{""TankId"":1041,""Name"":""StuG III Ausf. G"",""Description"":""Originally designed as an assault vehicle, this self-propelled gun was converted into a tank destroyer beginning with the F series. A total of 9,265 vehicles of this series and 1,211 of the Stu.H. 42 were produced."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/StuGIII.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/StuGIII.png"",""PriceCredit"":400000,""PriceGold"":0,""NexTanksInTree"":[11793,1553]},{""TankId"":2065,""Name"":""Pz.Kpfw. II"",""Description"":""The last modification of the light Pz. II tank. The vehicle featured enhanced armor, the 2 cm KwK 38 gun and improved observation devices. A total of 524 vehicles were built from March 1941 through December 1942."",""IsPremium"":false,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":1,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzII.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzII.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[785]},{""TankId"":8465,""Name"":""Panther II"",""Description"":""The vehicle was conceived in 1943. Two prototypes with the existing Panther I turrets were ordered in 1944. By 1945 only one of them had been built by the MAN company."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Panther_II.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Panther_II.png"",""PriceCredit"":2390000,""PriceGold"":0,""NexTanksInTree"":[10257]},{""TankId"":51985,""Name"":""Pz.Kpfw. S35 739 (f)"",""Description"":""Some of 400 of these French tanks were captured by the German Army. They were later used for training purposes and on secondary fronts."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/S35_captured.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/S35_captured.png"",""PriceCredit"":0,""PriceGold"":1200,""NexTanksInTree"":[]},{""TankId"":6929,""Name"":""Maus"",""Description"":""Developed from June 1942 through July 1944, with two prototypes produced, only one of which received a turret and armament."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Maus.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Maus.png"",""PriceCredit"":6100000,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":19729,""Name"":""Tiger 131"",""Description"":""This vehicle is the only Pz. Kpfw. VI Tiger in full working order. The vehicle was captured by the British 48th Royal Tank Regiment in Tunisia on April 21, 1943, and repaired later. It was shipped to the United Kingdom the same year. The British performed a full examination of the tank, and made it an exhibit item at the Bovington Tank Museum in 1951."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G136_Tiger_131.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G136_Tiger_131.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":4113,""Name"":""VK 30.02 (D)"",""Description"":""Developed as a response to, and influenced by, the Soviet T-34. The initial order for the production of 200 vehicles was canceled in favor of the Panther."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK3002DB.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK3002DB.png"",""PriceCredit"":1369000,""PriceGold"":0,""NexTanksInTree"":[13841]},{""TankId"":20753,""Name"":""M\u00E4uschen"",""Description"":""In summer 1942, the Porsche company received an order for the development of an assault tank with as much protection as possible and a powerful gun. One of the results of the superheavy Maus tank\u0027s development was the Typ 205 M\u00E4uschen, a design project with the same interior. Existed only in blueprints."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G110_Mauschen.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G110_Mauschen.png"",""PriceCredit"":3200000,""PriceGold"":0,""NexTanksInTree"":[6929]},{""TankId"":5137,""Name"":""Tiger II"",""Description"":""The most heavily armored tank carrying the most powerful anti-tank gun. The vehicle\u0027s drawbacks included an overloaded suspension and engine-transmission group, as well as excessive general mass. When engaging enemy vehicles at long range, the Tiger II had an upper hand over any other vehicle in terms of the gun and armor protection. However, due to the excessive mass of the vehicle, relatively low durability of the engine and transmission, and small total number of vehicles built, the Tiger II did not have any significant impact on the course of war."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzVIB_Tiger_II.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzVIB_Tiger_II.png"",""PriceCredit"":2450000,""PriceGold"":0,""NexTanksInTree"":[9745]},{""TankId"":21777,""Name"":""VK 90.01 (P)"",""Description"":""Esteemed professionals argue that the VK 90.01 (P) project is one of the suggestions for the development of heavy tanks with its rear turret placement and that it was never built and definitely never mass-produced. In fact, the VK 90.01 (P) was created in the Holiday Shop by Chris Dev, inventor extraordinaire and holiday enthusiast."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G_VK9001P.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G_VK9001P.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":55057,""Name"":""Pz.Kpfw. IV hydrostat."",""Description"":""This experimental version of the Pz.Kpfw. IV Ausf. G, incorporating hydrostatic drive, began development in 1944. Trials were discontinued due to the unreliability of the transmission and the lack of spare parts."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzIV_Hydro.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzIV_Hydro.png"",""PriceCredit"":0,""PriceGold"":2400,""NexTanksInTree"":[]},{""TankId"":6161,""Name"":""Pz.Kpfw. II Luchs"",""Description"":""As compared to the Pz.Kpfw. II Ausf. C, the vehicle featured a new hull and turret, as well as a chassis with a staggered arrangement of roadwheels. The reconnaissance tank had strong characteristics, but only 131 vehicles of the L modification were built, after manufacture proved to be too expensive."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":4,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzII_Luchs.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzII_Luchs.png"",""PriceCredit"":0,""PriceGold"":100,""NexTanksInTree"":[]},{""TankId"":22801,""Name"":""Icebreaker"",""Description"":""A Tiger I from the icy world of Eternal Winter. Powered by a cryogenic engine, it pushes forward into battle. Its parts give off a cold glow, its armor is tempered by the harsh frost, and its commander\u0027s heart won\u0027t be melted by the hottest battles in history!"",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzVI_AusfBP.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzVI_AusfBP.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":23825,""Name"":""Krupp-Steyr Waffentr\u00E4ger"",""Description"":""A vehicle project by Steyr as a special artillery transporter that would be able not only to transport the gun but also to fire it from the chassis. To keep costs down and reduce complexity, the design used many components of the Raupenschlepper Ost, a tracked artillery mover. The turret and gun were supplied by Krupp. One wooden model and one prototype were manufactured by September 2, 1944."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G109_Steyr_WT.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G109_Steyr_WT.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":8209,""Name"":""Pz.Kpfw. 38 (t) n.A."",""Description"":""Developed by the BMM company as a new light reconnaissance tank on the chassis of the Pz.Kpfw. 38 (t) from July 1940. The vehicle used welding technology instead of rivets. The new engine and improved transmission allowed for a top speed of 64 km/h. Development was discontinued in favor of the VK 1303. Five prototypes were manufactured."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":4,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz38_NA.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz38_NA.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":785,""Name"":""Pz.Kpfw. 35 (t)"",""Description"":""Developed by \u0160koda in 1935, the vehicle saw service in the Czechoslovakian army under the designation LT vz. 35. During the occupation of Czechoslovakia, the captured tanks were redesignated as Pz.Kpfw. 35 (t) and deployed with the Wehrmacht. The vehicles were actively used by the 1st Light Division (the 6th Panzer Division after reorganization) until the late 1941. A total of 434 tanks were manufactured."",""IsPremium"":false,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":2,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz35t.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz35t.png"",""PriceCredit"":1200,""PriceGold"":0,""NexTanksInTree"":[4369]},{""TankId"":10257,""Name"":""E 50"",""Description"":""In 1945 the E 50 was conceived as a standard medium tank of the Panzerwaffe to replace the Panther and Panther II. It existed only in blueprints."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/E-50.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/E-50.png"",""PriceCredit"":3450000,""PriceGold"":0,""NexTanksInTree"":[12305]},{""TankId"":60177,""Name"":""Panther mit 8,8 cm L/71"",""Description"":""Development of a modification of the Panther started in the spring of 1944. The new variant was to incorporate a newly designed Schmalturm turret. The new vehicle was designated the Panther Ausf. F. On January 23, 1945, it was reported that the 88-mm gun of the Tiger was mounted on the upgraded version of the new turret. A large number of hulls for the vehicle were manufactured, but the turret never saw production and existed only as a wooden model."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G106_PzKpfwPanther_AusfF.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G106_PzKpfwPanther_AusfF.png"",""PriceCredit"":0,""PriceGold"":7300,""NexTanksInTree"":[]},{""TankId"":5393,""Name"":""VK 16.02 Leopard"",""Description"":""The design of the VK 16.02, known as the Leopard, was based on the Panzer II Ausf. J (VK 16.01) and Panzer II Ausf. M (VK 13.01) that had been developed earlier. A dummy vehicle was ready in May\u2013June 1942, and the first prototype was built by September 1, 1942. According to \u0022Panzerprogramm 41\u0022, that provided for the manufacturing of 339 vehicles (105 by December 1943 and 150 by the middle of 1944), mass production was to be launched in April 1943 but never started. Later, the Leopard turret was mounted on the Sd.Kfz.234/2 designated as Puma."",""IsPremium"":false,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK1602.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK1602.png"",""PriceCredit"":400000,""PriceGold"":0,""NexTanksInTree"":[14097,10001]},{""TankId"":11281,""Name"":""Kampfpanzer 70"",""Description"":""An American-German collaboration from the 1960s, also known as the MBT-70. The vehicle never entered mass production because of disagreements between the parties. Later, the project split into two national programs. The KpfPz 70 was available during the Missile Exercise game event."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G_KpfPz_70.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G_KpfPz_70.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":12305,""Name"":""E 50 Ausf. M"",""Description"":""The German Army demanded that the E-series tanks had transmissions positioned in the rear. However, the E 50 and E 75 tanks used the Tiger II engine-transmission compartment, which made rear placement of the transmission impossible. The E 50 Ausf. M tank was a redesign of the E 50 project with the transmission placed in the rear."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/E50_Ausf_M.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/E50_Ausf_M.png"",""PriceCredit"":6100000,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":13329,""Name"":""Durchbruchswagen 2"",""Description"":""Prototype of a heavy tank, developed by the Henschel und Sohn company. The prototype was built in 1938. In September 1939 the VK 30.01 project was preferred, and the DW program was canceled. However, the DW I and DW II prototypes were used for various trials until 1941."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":4,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/DW_II.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/DW_II.png"",""PriceCredit"":0,""PriceGold"":100,""NexTanksInTree"":[]},{""TankId"":64273,""Name"":""Snowstorm Jagdtiger 8.8"",""Description"":""In 1945, the production order for the Jagdtiger was increased, and the supply of compatible guns became insufficient. As a result, approximately 20 vehicles were equipped with the 8,8 cm PaK 43 L/71 gun. The Snowstorm Jagdtiger 8,8 is a holiday event version of the traditional Jagdtiger 8,8. It was available in the Store only from 17 December 2014 through 5 January 2015."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/JagdTiger_SdKfz_185_Snowstorm.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/JagdTiger_SdKfz_185_Snowstorm.png"",""PriceCredit"":0,""PriceGold"":7400,""NexTanksInTree"":[]},{""TankId"":19473,""Name"":""Krupp-38(D)"",""Description"":""In 1944, German engineers were looking into the idea of installing a 75 mm gun KwK40 L/43 onto the hull of the Hetzer tank destroyer.  However the stage of blueprints showed the existing hull and turret need significant improvements. The initial plan was abandoned in favor of further experiments. In the game, the Krupp-38(D) is created according to blueprints but with a more powerful gun. "",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Krupp-38D.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Krupp-38D.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":58641,""Name"":""VK 72.01 (K)"",""Description"":""A superheavy tank with rear placement of the turret. Developed by the Krupp company. A new vehicle was to have stronger armament and enhanced armor compared to the VK 70.01. Existed only in blueprints."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK7201.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK7201.png"",""PriceCredit"":6100000,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":17425,""Name"":""Pz.Kpfw. IV Ausf. D"",""Description"":""This modification of the Pz IV was developed in October 1939. The vehicle had enhanced armor and an improved, external gun mantlet. The tank was mass-produced until May 1940, with a total of 229 vehicles manufactured."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":4,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz_IV_AusfD.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz_IV_AusfD.png"",""PriceCredit"":85000,""PriceGold"":0,""NexTanksInTree"":[5393,17]},{""TankId"":1809,""Name"":""Hetzer"",""Description"":""In 1943, the Wehrmacht were experiencing a dire shortage of StuG III tank destroyers because the joint U.S.A.-U.K. air raids caused considerable damage to the Alkett company\u0027s factory that produced these vehicles. December 1943, a decision was made to utilize the working capacities of the BMM company in Prague to start production of tank destroyers. Components of the Pz.Kpfw. 38(t) tank were widely used in the new vehicle. The first prototypes were produced in March 1944. More than 2,800 vehicles were built by May 1945."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":4,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Hetzer.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Hetzer.png"",""PriceCredit"":85000,""PriceGold"":0,""NexTanksInTree"":[1041]},{""TankId"":18449,""Name"":""Ru 251"",""Description"":""The vehicle was developed on the basis of the Kanonenjagdpanzer 4-5 tank destroyer by the Henschel company in 1964. The tank was planned to replace the obsolete M41 Walker Bulldog vehicles used by the reconnaissance battalions of the armored divisions in the German Army. The tank never saw mass production, but some technical innovations were applied later in the development of other vehicles. The total number of prototypes built is unknown."",""IsPremium"":false,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G103_RU_251.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G103_RU_251.png"",""PriceCredit"":2440000,""PriceGold"":0,""NexTanksInTree"":[14865]},{""TankId"":529,""Name"":""Tiger I"",""Description"":""Development of the Tiger I was started in 1937 by the Henschel company. Mass production began in 1942, with an eventual total of 1,354 vehicles manufactured. The tank first saw combat in the fighting for Leningrad, and Tigers were at the forefront of battles from Tunisia to Kursk. Although production was discontinued in the summer of 1944, the Tiger I continued to see action until the end of the war."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzVI.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzVI.png"",""PriceCredit"":1390000,""PriceGold"":0,""NexTanksInTree"":[5137]},{""TankId"":20497,""Name"":""VK 100.01 (P)"",""Description"":""A version of the Maus from June 4, 1942. The 120-ton predecessor of the superheavy tank existed only in blueprints and never saw service. This vehicle was only an intermittent stage in the development of the Maus."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G115_VK10001P.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G115_VK10001P.png"",""PriceCredit"":2450000,""PriceGold"":0,""NexTanksInTree"":[20753]},{""TankId"":4881,""Name"":""Pz.Kpfw. III Ausf. A"",""Description"":""An order for designing a 15-ton tracked vehicle with a gun armament was placed in 1935. Despite the weight of the Pz. Kpfw. III Ausf. E, the first large-scale vehicle, reached 19.5 tons, its configuration was deemed successful, and the number of vehicles eventually grew to 96. Further modifications became even more popular, and the Pz. Kpfw. III became the most mass-produced vehicle of the Wehrmacht."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzIII_A.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzIII_A.png"",""PriceCredit"":0,""PriceGold"":50,""NexTanksInTree"":[]},{""TankId"":21521,""Name"":""E 75 TS"",""Description"":""One of the projects for further developing and modernizing the E 75 tank. There were plans to mount a gas-turbine engine and a shielded cast turret. It existed only in blueprints."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G_E-75TS.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G_E-75TS.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":22545,""Name"":""Kanonenjagdpanzer 105"",""Description"":""The first prototypes of the Kanonenjagdpanzer were produced in 1960 by the Hanomag and Henschel companies for the FRG. Mass production continued until 1967. A total of 770 vehicles for the Bundeswehr and 80 for the Belgian Armed Forces were built. In 1983, the vehicle was deemed outdated. According to engineers, some of them could be equipped with 105 mm guns, but the vehicles were eventually converted into artillery observation vehicles or anti-tank guided missile carriers. The Kanonenjagdpanzer (also known as Jagdpanzer Kanone 90mm) remained in service in citizen military forces until 1990."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G112_JagdPanzer_105.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G112_JagdPanzer_105.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":23569,""Name"":""Pz. IV Gargoyle"",""Description"":""A special variant of the Pz. IV G straight from the Shooting Gallery event. This sharp-toothed vehicle never misses a chance to test the strength of enemy armor! Its gun deals tremendous damage with every shot, and the quick turret won\u0027t let enemies escape your sight. "",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz_IV_AusfBT.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz_IV_AusfBT.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":7953,""Name"":""Jagdtiger"",""Description"":""Developed from 1942 through 1944, the heavy tank destroyer, with the chassis of the Tiger II heavy tank, became the heaviest mass-produced armored vehicle ever. According to various sources, 70\u201379 tank destroyers were manufactured from 1944 through 1945. The vehicles saw service in the 653rd and 512th Heavy Panzerj\u00E4ger Battalions."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/JagdTiger.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/JagdTiger.png"",""PriceCredit"":3450000,""PriceGold"":0,""NexTanksInTree"":[12049]},{""TankId"":24593,""Name"":""Keiler"",""Description"":""One of the projects for further developing and modernizing the E 75 tank. There were plans to mount a gas-turbine engine and a shielded cast turret. It existed only in blueprints."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G_E-75RT.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G_E-75RT.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":3345,""Name"":""Pz.Kpfw. 38 (t)"",""Description"":""Developed by the \u010CKD company for the Czechoslovakian Army in 1938. During the German occupation, the vehicle saw service in the Wehrmacht and was used in the Polish and French Campaigns, as well as on the Eastern Front. The tank saw combat on the front line until the middle of 1942. Approximately 1,400 vehicles in eight modifications (Ausf. A/B/C/D/E/F/S/G) were manufactured."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz38t.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz38t.png"",""PriceCredit"":0,""PriceGold"":50,""NexTanksInTree"":[]},{""TankId"":10001,""Name"":""VK 28.01"",""Description"":""The vehicle was intended as a standard light tank of the Panzerwaffe and a basis for antiaircraft tanks and vehicles able to ride on any terrain and railroad tracks. Existed only in blueprints."",""IsPremium"":false,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK2801.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK2801.png"",""PriceCredit"":945000,""PriceGold"":0,""NexTanksInTree"":[18961]},{""TankId"":11025,""Name"":""Sturer Emil"",""Description"":""Experimental tank destroyer developed on the basis of the VK 30.01(H) heavy tank. Only two vehicles were manufactured. They fought on the Eastern Front. The tank destroyer was designated as \u201CSturer Emil\u201D (German for \u201CStubborn Emil\u201D) due to frequent breakdowns."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Sturer_Emil.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Sturer_Emil.png"",""PriceCredit"":1300000,""PriceGold"":0,""NexTanksInTree"":[16657]},{""TankId"":64017,""Name"":""Tankenstein"",""Description"":""Tankenstein is a unique vehicle created for Halloween 2015. The tank consists of modules from other vehicles and features special camouflage and a unique appearance. According to some secret dispatches, a surreptitious community of German scientists was involved in the creation of Tankenstein."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/S01_Frankentank.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/S01_Frankentank.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":12049,""Name"":""Jagdpanzer E 100"",""Description"":""The E 100 was conceived as the basis for a self-propelled gun, an antiaircraft vehicle, and a tank destroyer. However, development was never started."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/JagdPz_E100.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/JagdPz_E100.png"",""PriceCredit"":6100000,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":13073,""Name"":""Pz.Kpfw. II Ausf. G"",""Description"":""The German WWII light reconnaissance tank was a modification of the Pz. II tank. The vehicle featured an improved hull and suspension, a more powerful engine, and observation devices for the radio operator and driver, which increased the view range."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz_II_AusfG.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz_II_AusfG.png"",""PriceCredit"":0,""PriceGold"":50,""NexTanksInTree"":[]},{""TankId"":62993,""Name"":""VK 45.03"",""Description"":""Heavy tank developed at the end of WWII. The project was designated the Tiger III (VK 45.03) on October 12, 1942. Existed only in blueprints."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G118_VK4503.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G118_VK4503.png"",""PriceCredit"":0,""PriceGold"":5000,""NexTanksInTree"":[]},{""TankId"":14097,""Name"":""VK 30.01 (D)"",""Description"":""In the winter of 1941\u20131942 the WaPr\u00FCf 6 issued technical requirements for a new 30-ton tank. The orders for development were placed with MAN and Daimler-Benz. The prototypes were to be ready by May 1942. However, on May 13th, 1942 only comparative characteristics of the projects were submitted. The MAN\u0027s project was preferred, and the Daimler-Benz\u0027s project was canceled."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK3002DB_V1.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK3002DB_V1.png"",""PriceCredit"":910000,""PriceGold"":0,""NexTanksInTree"":[4113,1297]},{""TankId"":16145,""Name"":""Pz.Sfl. IVc"",""Description"":""Proposed antiaircraft vehicle mounting the 88-mm antiaircraft gun. Development started in Germany in 1941. The vehicle was based on the Pz.Sfl.IVc chassis. The operational requirements for the vehicle were constantly changed, and the FlaK 41 gun was mounted on the chassis only in 1944. The vehicle was to be the basis of variants with other armament alternatives. However, the plan was never implemented. Only three prototypes were manufactured."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz_Sfl_IVc.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz_Sfl_IVc.png"",""PriceCredit"":0,""PriceGold"":250,""NexTanksInTree"":[]},{""TankId"":24081,""Name"":""U-Panzer"",""Description"":""A tank that was raised from the depths of the sea at an incredibly long distance from the coast. How did it get there? Judging by the special tube, cylinders, and winch, it arrived under its own power! Although its diving equipment doesn\u0027t work anymore, the tank retained the name U-Panzer in memory of its underwater trip."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK3002DB_BP.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK3002DB_BP.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":17169,""Name"":""Pz.Kpfw. IV Ausf. A"",""Description"":""Development of the vehicle started in 1935. It was nicknamed Pz Kpfw IV in April 1936. Mass production began in the fall of 1937, and the first vehicles saw service starting in 1938. A total of 35 vehicles were manufactured and were in service until 1941."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pz_IV_AusfA.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pz_IV_AusfA.png"",""PriceCredit"":0,""PriceGold"":50,""NexTanksInTree"":[]},{""TankId"":1553,""Name"":""Jagdpanzer IV"",""Description"":""The Pz. IV medium tank served as the basis for many vehicles, including tank destroyers. At the end of 1944, a version of the 75-mm PaK 42 L/70 gun was prepared for this basis. The new variant of the vehicle was designated the JagdPzIV/70. From August 1944 through March 1945, the Nibelungenwerke company produced 278 vehicles of this type."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/JagdPzIV.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/JagdPzIV.png"",""PriceCredit"":910500,""PriceGold"":0,""NexTanksInTree"":[3857]},{""TankId"":51473,""Name"":""Pz.Kpfw. V/IV"",""Description"":""This vehicle was produced by the Maintenance and Recovery Company of the 653rd Heavy Panzerj\u00E4ger Battalion on the basis of the Bergepanther ARV and the Pz. IV turret."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzV_PzIV.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzV_PzIV.png"",""PriceCredit"":0,""PriceGold"":2400,""NexTanksInTree"":[]},{""TankId"":2577,""Name"":""VK 30.01 (H)"",""Description"":""An order for developing the vehicle was placed on September 9, 1939. Over the course of its development, Henschel engineers actively used elements of the D.W. II project. The first two prototypes were ready in March 1942; another two were built by October the same year. Hulls of the prototypes underwent trials at the plant proving ground. After the trials, two prototypes were converted into heavy tank destoyers. Six turrets manufactured by the Krupp company were placed at the Atlantic Wall."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK3001H.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK3001H.png"",""PriceCredit"":0,""PriceGold"":250,""NexTanksInTree"":[]},{""TankId"":19217,""Name"":""Grille 15"",""Description"":""In the summer of 1942, Waffenamt (the German Army Weapon Agency) concluded an agreement with the Krupp and Rheinmetall companies for designing a tank destroyer on the chassis of the Panther tank. It was planned to mount either the 128-mm K 43 gun or the 150-mm sFH 43 howitzer. The projects were designated Grille 12 and Grille 15, featured rear placement of the fighting compartment, and differed only in the artillery system type. Later, the Grille 15 received a 150-mm gun with a length of 63 calibers, which could penetrate 200 mm of armor at 4,000 meters. However, development was slow, and the Grille 15 remained only in blueprints."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":10,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G121_Grille_15_L63.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G121_Grille_15_L63.png"",""PriceCredit"":6100000,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":2321,""Name"":""VK 36.01 (H)"",""Description"":""An experimental German WWII heavy tank developed by Henschel. The vehicle was a further development of the VK 30.01 (H) project and a stage in the design process for the Tiger. A total of eight chassis and one prototype were built in 1942. During the development, various technical solutions were trialed. Some of them later served as a basis for German heavy tank designs during the WWII. The chassis was also used in armored recovery vehicles."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK3601H.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK3601H.png"",""PriceCredit"":935000,""PriceGold"":0,""NexTanksInTree"":[529]},{""TankId"":3601,""Name"":""Panzerj\u00E4ger I"",""Description"":""Development of the Panzerj\u00E4ger I, the German tank destroyer, started in 1939 based on the Panzerkampfwagen I Ausf. B. Initially, the 37-mm Pak 36 gun was mounted on the chassis of the Panzerkampfwagen I Ausf. B. However, during the invasion of Poland, it was revealed that the gun was not effective against new vehicles. After Germany captured Czechoslovakia in 1940, the 47-mm Pak 36(t) L/43.4 (\u0160koda 47-mm A-5 KP \u00DAV vz. 38 Model A5) gun was mounted on the tank destroyer. A total of 202 vehicles were manufactured and saw action until 1943."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":2,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PanzerJager_I.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PanzerJager_I.png"",""PriceCredit"":0,""PriceGold"":25,""NexTanksInTree"":[]},{""TankId"":62737,""Name"":""leKpz M 41 90 mm"",""Description"":""The German modification of the M41A1 Walker Bulldog U.S. light tank. Major changes were introduced to the 76 mm gun M32, which was reamed out to 90 mm and shortened by 425 mm."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G120_M41_90.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G120_M41_90.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":21265,""Name"":""VK 168.01 (P)"",""Description"":""In the summer of 1942, Porsche received an order for a breakthrough vehicle with the most powerful armament and thickest armor possible for such a class. VK 168.01 was a further development of the M\u00E4uschen project. The main difference was in the frontal placement of the turret. Existed only in blueprints."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G138_VK16801P.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G138_VK16801P.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":54545,""Name"":""T-25"",""Description"":""The vehicle was developed by the \u0160koda company under the Panzer Development Program initiated by the Heer (German Army land forces). The T-25 existed only in blueprints."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":5,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/T-25.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/T-25.png"",""PriceCredit"":0,""PriceGold"":2100,""NexTanksInTree"":[]},{""TankId"":6673,""Name"":""Marder II"",""Description"":""Light tank destroyer developed in early 1942 based on the chassis of the outdated, but massively produced, Pz.Kpfw. II, and fitted with a powerful gun. The vehicle saw wide use on the Eastern Front; from 1944, it also fought in Italy and on the Western Front. The tank destroyer was in service until the end of the war."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G20_Marder_II.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G20_Marder_II.png"",""PriceCredit"":0,""PriceGold"":50,""NexTanksInTree"":[]},{""TankId"":7697,""Name"":""Ferdinand"",""Description"":""Developed on the basis of the Porsche Tiger, with a total of 90 vehicles produced in April and May 1943. They first saw combat in the Battle of Kursk (Operation Citadel)."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Ferdinand.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Ferdinand.png"",""PriceCredit"":2570000,""PriceGold"":0,""NexTanksInTree"":[7953]},{""TankId"":24337,""Name"":""M48A2 R\u00E4umpanzer"",""Description"":""The predecessor of engineering vehicles, developed on the basis of the American M48 post-war medium tank. Equipped with the M8A1 dozer blade, these vehicles entered service in Bundeswehr engineering units and were used until the late 1990s in territorial forces, but with demounted guns. A total of 53 vehicles saw service in Bundeswehr."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G142_M48RPz.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G142_M48RPz.png"",""PriceCredit"":0,""PriceGold"":0,""NexTanksInTree"":[]},{""TankId"":57617,""Name"":""Panther/M10"",""Description"":""During the preparation of Otto Skorzeny\u0027s Panzerbrigade 150 for the Ardennes offensive, four Panther tanks were disguised as M10 tank destroyers. The tank brigade was to carry out diversions deep behind the allied lines. All vehicles were lost during the battle with the 120th U.S. Infantry Regiment on February 21, 1945."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Panther_M10.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Panther_M10.png"",""PriceCredit"":0,""PriceGold"":4750,""NexTanksInTree"":[]},{""TankId"":3857,""Name"":""Jagdpanther"",""Description"":""Development of this tank destroyer, based on the chassis of the new VK 30.02 (MAN) tank, began in 1942. In October 1943, the prototype trials were started. A total of 392 vehicles were manufactured."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/JagdPanther.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/JagdPanther.png"",""PriceCredit"":1345000,""PriceGold"":0,""NexTanksInTree"":[7697,11537]},{""TankId"":57105,""Name"":""Dicker Max"",""Description"":""The Dicker Max (\u0022Fat Max\u0022) was initially intended to destroy bunkers. Two prototypes were built in the spring of 1941. Later the vehicle was redesignated a heavy tank destroyer. The design was never put into mass production, but the prototypes fought on the Eastern Front."",""IsPremium"":true,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/DickerMax.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/DickerMax.png"",""PriceCredit"":0,""PriceGold"":2900,""NexTanksInTree"":[]},{""TankId"":9745,""Name"":""E 75"",""Description"":""In 1945 the E 75 was conceived as a standard heavy tank of the Panzerwaffe to replace the Tiger II. It existed only in blueprints."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/E-75.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/E-75.png"",""PriceCredit"":3480000,""PriceGold"":0,""NexTanksInTree"":[9489]},{""TankId"":7441,""Name"":""VK 45.02 (P) Ausf. B"",""Description"":""Two designs of this vehicle (one with the forward-mounted turret and the other with the rear-mounted turret) were drawn up by Ferdinand Porsche. The tank never saw mass production."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK4502P.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK4502P.png"",""PriceCredit"":3598000,""PriceGold"":0,""NexTanksInTree"":[58641]},{""TankId"":59665,""Name"":""Gro\u00DFtraktor - Krupp"",""Description"":""An experimental medium tank, developed by the Krupp company. By 1929, two prototypes were manufactured from non-armored steel and underwent trials in the Soviet Union until 1933. The trials revealed multiple faults, and the vehicle never saw service. However, the results of vehicle development were later used by German engineers."",""IsPremium"":true,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/G100_Gtraktor_Krupp.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/G100_Gtraktor_Krupp.png"",""PriceCredit"":0,""PriceGold"":1200,""NexTanksInTree"":[]},{""TankId"":10769,""Name"":""Tiger (P)"",""Description"":""On May 26, 1941, Adolf Hitler ordered Ferdinand Porsche and the Henschel company to develop prototypes of a new heavy tank. The prototypes were shown to the F\u00FChrer on April 20, 1942. Manufacturing began, but the production run was cut short due to the complexity of the tank\u0027s drive and control systems, and a shortage of the required copper. Later, 90 produced hulls were converted into Ferdinand tank destroyers."",""IsPremium"":false,""TypeId"":""heavyTank"",""NationId"":""germany"",""Tier"":7,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/PzVI_Tiger_P.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/PzVI_Tiger_P.png"",""PriceCredit"":1395000,""PriceGold"":0,""NexTanksInTree"":[10513,20497,7697]},{""TankId"":11793,""Name"":""Nashorn"",""Description"":""The official designation of the Nashorn (\u0022Rhinoceros\u0022) tank destroyer was 8.8 cm PaK 43/1 auf Gesch\u00FCtzwagen III/IV (Sf). The vehicle was designated the Hornisse (\u0022Hornet\u0022) until 1944. Produced on the same chassis as the Hummel heavy SPG. The vehicle first saw combat on the Eastern Front in the summer of 1943. A total of 494 vehicles were manufactured."",""IsPremium"":false,""TypeId"":""AT-SPG"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Nashorn.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Nashorn.png"",""PriceCredit"":905000,""PriceGold"":0,""NexTanksInTree"":[11025,3857]},{""TankId"":13841,""Name"":""Indien-Panzer"",""Description"":""The project was developed as a medium tank for the Indian Army. The work on the project was carried out by Porsche, Daimler-Benz, and Zahnradfabrik AG of Friedrichshafen. However, the vehicle was deemed to be too complicated for production in India, and the project was canceled."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":8,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Indien_Panzer.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Indien_Panzer.png"",""PriceCredit"":2420000,""PriceGold"":0,""NexTanksInTree"":[14865]},{""TankId"":54801,""Name"":""T-15"",""Description"":""This experimental light tank was developed at the \u0160koda factory in 1941\u20131943, with a total of five prototypes manufactured. The vehicle was never mass-produced, nor saw service."",""IsPremium"":true,""TypeId"":""lightTank"",""NationId"":""germany"",""Tier"":3,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/T-15.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/T-15.png"",""PriceCredit"":0,""PriceGold"":950,""NexTanksInTree"":[]},{""TankId"":14865,""Name"":""Leopard Prototyp A"",""Description"":""Prototype developed from 1960 through 1961 as a medium tank for the Bundeswehr, with a total of 26 prototypes manufactured. The prototypes were tested up to 1963. The vehicle was the predecessor of the Leopard medium tank."",""IsPremium"":false,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":9,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/Pro_Ag_A.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/Pro_Ag_A.png"",""PriceCredit"":3450000,""PriceGold"":0,""NexTanksInTree"":[14609]},{""TankId"":15889,""Name"":""VK 30.02 (M)"",""Description"":""A medium tank, developed by the MAN company and designed as a 30-ton tank. Simultaneously, the Daimler-Benz company developed a competing project. On May 13, 1942, the two projects were submitted to the Ministry of Armaments and War Production. The MAN design was preferred, and the tank eventually entered service as the Pz.Kpfw. V Panther."",""IsPremium"":true,""TypeId"":""mediumTank"",""NationId"":""germany"",""Tier"":6,""PreviewImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd_thumbnail/VK3002M.png"",""NormalImage"":""http://glossary-eu-static.gcdn.co/icons/wotb/current/uploaded/vehicles/hd/VK3002M.png"",""PriceCredit"":0,""PriceGold"":500,""NexTanksInTree"":[]}]}";

